using System;
using System.Collections.Generic;
using System.ComponentModel;
using System.ComponentModel.DataAnnotations;
using System.ComponentModel.DataAnnotations.Schema;
using System.Linq;
using System.Web;

namespace MyMoviesCatalogApp.Models
{
    public interface ITrackableMovieCatalogEntity
    {
        DateTime? CreatedAt { get; set; }
        DateTime? LastUpdatedAt { get; set; }
        string CreatedUserID { get; set; }
        string LastUpdatedUserID { get; set; }

        ApplicationUser CreatedUser { get; set; }
        ApplicationUser LastUpdatedUser { get; set; }
    }

    public class MovieCatalogEntity : ITrackableMovieCatalogEntity
    {        
        public int ID { get; set; }
        [DisplayName("Name")]
        public virtual string Name { get; set; }
        [DisplayName("Description")]
        public string Description { get; set; }
        [DisplayName("Photo")]
        public byte[] Photo { get; set; }
        public string PhotoContentType { get; set; }

        [ForeignKey("CreatedUser")]
        public string CreatedUserID { get; set; }
        [ForeignKey("LastUpdatedUser")]
        public string LastUpdatedUserID { get; set; }
        [DisplayName("Posted")]
        public DateTime? CreatedAt { get; set; }
        [DisplayName("Last modified")]
        public DateTime? LastUpdatedAt { get; set; }

        [DisplayName("Posted by")]
        public ApplicationUser CreatedUser { get; set; }
        [DisplayName("Modified by")]
        public ApplicationUser LastUpdatedUser { get; set; }

        public virtual T Change<T>(Action<T> action) where T : MovieCatalogEntity
        {
            action(this as T);
            return this as T;
        }

        public bool HasPhoto()
        {
            return Photo != null && Photo.Length > 0;
        }

        public string GetPhotoAsBase64String()
        {
            if (HasPhoto())
                return string.Format("data:{0};base64,{1}", PhotoContentType, Convert.ToBase64String(Photo, 0, Photo.Length));
            else
                return ComingSoonPictureBase64String;
        }

        public static readonly string ComingSoonPictureBase64String = "data:image/jpeg;base64,";

        public override string ToString()
        {
            return Name;
        }

    }
}